column8:
シルバーペアリング　
<br>

<TABLE border="0" width="390">
  <TBODY>
    <TR>
      <TD height="231">
<font color=#696969 size="2">
大切な人と心を分かち合うシルバー・ペア・リング。</font><br>
<font color=#696969 size="2">
優美に洗練されたフォルムに小さな秘密が…</font><br>
<font color=#0099FF size="2">ふたつのリングを重ねあうと、エッジ・ラインがコンプリート・ハートを形づくります。</font><br>
<br>
<img src="http://image.rakuten.co.jp/vieange/cabinet/lovers_scene/lsr/lsr0098pair.jpg" width="200" height="200" /><br>
<font color=#696969 size="2">■素材■</font><br>
<br>
<font color=#696969 size="2">SV925（ロジウム・コーティング）</font><br>
<font color=#696969 size="2">ダイヤモンド（レディースのみ）</font><br>
<br>
<font color=#696969 size="2">■大きさ(mm)■</font><br>
<br>
<font color=#696969 size="2">（レディース）幅約2.3×厚み約2.0</font><br>
<font color=#696969 size="2">（メンズ）幅約2.7×厚み約2.2</font><br>
<br>
 <font color=#696969 size="2">■重量■</font><br>
<br>
<font color=#696969 size="2">（レディース）約2.1g</font><br>
<font color=#696969 size="2">（メンズ）約2.4g</font><br>
<br>
<font color=#696969 size="-2">※サイズ・重量には多少の個体差が出ます※</font><br>
<br>
<font color="ff0000"><b>このリングは奇数サイズのみのお取り扱いです。<br>
また、サイズ直しも出来ませんので、サイズをよくお確かめの上ご注文下さい。</b></font>
</TD>
    </TR>
  </TBODY>
</TABLE><br>
<br>
<br>
<img src="http://image.rakuten.co.jp/vieange/cabinet/parts/ls_kokuin.jpg" width="400" height="35" alt="刻印サービス"  />

<br><br>

<p>リングの内側にメッセージやお名前などを刻印することができます。<br>
刻字機を使ってクラフトマンが手作業で1文字1文字丁寧に刻印致します。</p>


<br>


■&nbsp;刻印納期&nbsp;■<br>
プラス約１週間<br><br>

■&nbsp;刻印料金&nbsp;■<br>
リング１本につき\1,500（税抜）<br><br>

■&nbsp;刻印可能文字数&nbsp;■<br>
8文字<br>
（記号、スペース、マークなども１文字分としてカウントされます。）<br><br>

■&nbsp;書体&nbsp;■<br>
ブロック体（丸ゴシック）のみ<br><br>

<img src="http://image.rakuten.co.jp/vieange/cabinet/parts/teborikokuin.jpg" width="400" height="400" alt="刻印書体見本"  />

<br><br><br>


<strong>■&nbsp;刻印のご注文方法&nbsp;■</strong><br><br>

プルダウン・メニューから「希望する」をお選びください。<br>
注文画面の「お店へのメッセージ」欄に刻印内容をご記入ください。<br>
また、刻印対象商品が分かるよう、レディースかメンズもご併記願います。
<br><br>
<font color="#FF0000"><strong>【重要】<br>ご注文確認後、 商品代金に刻印料を加算してご請求金額を変更させていただきます。
刻印料加算後のご請求金額については、ご注文確認後にお送りするメールをご確認願います。</strong></font><!--▼▼ 左帯リンクあり ▼▼-->

